import { useEffect, useState } from 'react'

function Content() {
  const [count, setCount] = useState(0)
  const handleAdd = () => {
    setCount(count + 1)
  }

  return (
    <div>
      <h1>{{ count }}</h1>
      <button onClick={handleAdd}></button>
    </div>
  )
}
export default Content
